import posts from '../Posts/MyPosts.module.css';
import Post from './Post/Post.jsx';
function MyPosts() {
    return (
        <div>
            <div className={posts.my}>
                MyPosts
            </div>
            <div className={posts.new}>
                New Posts
            </div>
            <Post/>
        </div>
    );
}

export default MyPosts;
